import "./App.css";
import { useEffect } from "react";

function App() {
  useEffect(() => {
    let ignore = false;

    async function getData() {
      const res = await fetch("http://localhost:8080/");
      const data = res.json();
      if (!ignore) console.log(data);
    }

    getData();

    return () => {
      ignore = true;
    };
  }, []);

  return <h1>Hello World</h1>;
}

export default App;
